import axios from '../../config/axios'

class Logout extends React.Component {
    componentDidMount() {
        axios.delete('/users/logout')
        .then((response) => {
            const user = response.data
            localStorage.removeItem('authToken')
            this.props.history.push('/')

        })
        .catch((err) => {
            alert(err)
        })
    }
    render() {
        return (
            <div></div>
        )
    }
}

export default Logout
